import React, { useState, useEffect } from 'react';
import { 
  Button, 
  Container, 
  Grid, 
  Paper, 
  Typography, 
  Box,
  TextField,
  Accordion,
  AccordionSummary,
  AccordionDetails,
  Switch,
  FormControlLabel,
  CircularProgress,
  LinearProgress
} from '@mui/material';
import CompareArrowsIcon from '@mui/icons-material/CompareArrows';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import DownloadIcon from '@mui/icons-material/Download';
import './JsonComparison.css';

function JsonComparison() {
  const [file1, setFile1] = useState(null);
  const [file2, setFile2] = useState(null);
  const [comparisonResult, setComparisonResult] = useState(null);
  const [error, setError] = useState(null);
  const [expandedPages, setExpandedPages] = useState({});
  const [showOnlyDifferences, setShowOnlyDifferences] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [progress, setProgress] = useState(0);
  const [serverPort, setServerPort] = useState(3001);

  useEffect(() => {
    findServerPort();
  }, []);

  useEffect(() => {
    console.log('comparisonResult:', comparisonResult);
  }, [comparisonResult]);

  const findServerPort = async () => {
    for (let port = 3001; port < 3010; port++) {
      try {
        const response = await fetch(`http://localhost:${port}/health`, { method: 'GET' });
        if (response.ok) {
          setServerPort(port);
          console.log(`Server found on port ${port}`);
          return;
        }
      } catch (error) {
        // Port is not available, continue to the next one
      }
    }
    console.error('Could not find an available server port');
  };

  const handleFileChange = (event, setFile) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    reader.onload = (e) => {
      try {
        const json = JSON.parse(e.target.result);
        setFile(json);
        setError(null);
      } catch (error) {
        console.error('Error parsing JSON:', error);
        setError('Error parsing JSON file. Please ensure it\'s a valid JSON.');
      }
    };
    reader.readAsText(file);
  };

  const handleCompare = async () => {
    setIsLoading(true);
    setComparisonResult(null);
    setError(null);

    try {
      console.log('Sending comparison request');
      console.log('file1:', file1);
      console.log('file2:', file2);

      const response = await fetch(`http://localhost:${serverPort}/compare`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ oldJson: file1, newJson: file2 }),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const result = await response.json();
      console.log('Comparison result:', result);
      setComparisonResult(result);
    } catch (error) {
      console.error('Error during comparison:', error);
      setError('An error occurred during comparison. Please try again.');
    } finally {
      setIsLoading(false);
    }
  };

  const togglePage = (page) => {
    setExpandedPages(prev => {
      const newState = { ...prev, [page]: !prev[page] };
      // Find the corresponding page in the other column
      const otherPage = Object.keys(comparisonResult.differences).find(key => 
        normalizeUrl(key) === normalizeUrl(page)
      );
      if (otherPage) {
        newState[otherPage] = newState[page];
      }
      return newState;
    });
  };

  const renderJsonWithHighlights = (json, differences) => {
    if (!json || !differences) {
      return <Typography>No comparison result available.</Typography>;
    }

    return Object.entries(differences).map(([page, pageDifferences]) => {
      if (showOnlyDifferences && !hasDifferences(pageDifferences)) {
        return null;
      }

      return (
        <Accordion 
          key={page} 
          expanded={expandedPages[page] || false}
          onChange={() => togglePage(page)}
        >
          <AccordionSummary expandIcon={<ExpandMoreIcon />}>
            <Typography>{page}</Typography>
          </AccordionSummary>
          <AccordionDetails>
            <ul>
              {json[page]?.map((link, index) => {
                let color = 'inherit';
                let prefix = '';
                if (pageDifferences.missing?.includes(link)) {
                  color = 'red';
                  prefix = '- ';
                } else if (pageDifferences.extra?.includes(link)) {
                  color = 'green';
                  prefix = '+ ';
                }
                return (
                  <li key={index} style={{ color }}>
                    {prefix}{link}
                  </li>
                );
              })}
              {pageDifferences.redirected?.map((redirect, index) => (
                <li key={`redirect-${index}`} style={{ color: 'orange' }}>
                  Redirect: {redirect.from} → {redirect.to}
                </li>
              ))}
            </ul>
          </AccordionDetails>
        </Accordion>
      );
    });
  };

  const hasDifferences = (pageDifferences) => {
    return (
      (pageDifferences.missing && pageDifferences.missing.length > 0) ||
      (pageDifferences.extra && pageDifferences.extra.length > 0) ||
      (pageDifferences.redirected && pageDifferences.redirected.length > 0)
    );
  };

  const normalizeUrl = (url) => {
    try {
      const parsedUrl = new URL(url);
      return parsedUrl.pathname;
    } catch (error) {
      console.error('Error normalizing URL:', url, error);
      return url;
    }
  };

  const generateDifferencesJson = () => {
    if (!comparisonResult) return null;

    const differences = {};
    Object.entries(comparisonResult.differences).forEach(([page, diffs]) => {
      if (diffs.missing && diffs.missing.length > 0) {
        differences[page] = diffs.missing;
      }
    });

    return JSON.stringify(differences, null, 2);
  };

  const handleDownload = () => {
    const differencesJson = generateDifferencesJson();
    if (!differencesJson) return;

    const blob = new Blob([differencesJson], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'missing_links.json';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
    URL.revokeObjectURL(url);
  };

  console.log('Rendering JsonComparison', { file1, file2, comparisonResult });

  return (
    <Container maxWidth="lg">
      <Paper elevation={3} className="input-section">
        <Typography variant="h4" gutterBottom>
          JSON Comparison Tool
        </Typography>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} md={5}>
            <TextField
              fullWidth
              type="file"
              onChange={(e) => handleFileChange(e, setFile1)}
              accept=".json"
              label="Old Website JSON"
              InputLabelProps={{ shrink: true }}
            />
          </Grid>
          <Grid item xs={12} md={2} className="compare-icon">
            <CompareArrowsIcon fontSize="large" />
          </Grid>
          <Grid item xs={12} md={5}>
            <TextField
              fullWidth
              type="file"
              onChange={(e) => handleFileChange(e, setFile2)}
              accept=".json"
              label="New Website JSON"
              InputLabelProps={{ shrink: true }}
            />
          </Grid>
        </Grid>
        <Box mt={2} display="flex" flexDirection="column" alignItems="center" gap={2}>
          <Box display="flex" justifyContent="center" gap={2} alignItems="center">
            <Button 
              variant="contained" 
              color="primary" 
              onClick={handleCompare}
              startIcon={<CompareArrowsIcon />}
              disabled={!file1 || !file2 || isLoading}
            >
              Compare
            </Button>
            {isLoading && <CircularProgress size={24} />}
            {comparisonResult && (
              <Button 
                variant="contained" 
                color="secondary" 
                onClick={handleDownload}
                startIcon={<DownloadIcon />}
              >
                Download Differences
              </Button>
            )}
          </Box>
          {isLoading && (
            <Box width="100%" maxWidth={400}>
              <LinearProgress variant="determinate" value={progress} />
              <Typography variant="body2" color="textSecondary" align="center">
                {`${Math.round(progress)}%`}
              </Typography>
            </Box>
          )}
        </Box>
      </Paper>

      {error && (
        <Paper elevation={3} className="error-section">
          <Typography color="error">{error}</Typography>
        </Paper>
      )}

      {comparisonResult && (
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <FormControlLabel
              control={
                <Switch
                  checked={showOnlyDifferences}
                  onChange={(e) => setShowOnlyDifferences(e.target.checked)}
                />
              }
              label="Show only differences"
            />
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h6">Old Website</Typography>
            {renderJsonWithHighlights(file1, comparisonResult.differences)}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h6">New Website</Typography>
            {renderJsonWithHighlights(file2, comparisonResult.differences)}
          </Grid>
        </Grid>
      )}
    </Container>
  );
}

export default JsonComparison;
